import React from 'react';
import './App.scss';
import Header from "./header/Header";
import Wrapper from "./interactions/Wrapper";
import Footer from "./Footer";
import Test from "./Test";




class App extends React.Component {
    render() {

        return (
            <>
                <Wrapper/>
                <nav>
                    <Header/>
                </nav>
                <div className="last-content">
                    <main>
                        {this.props.children}
                    </main>
                </div>



                <section className="welcome-outer-wrapper">
                    <div id="welcome_wrapper" className="welcome-wrapper layout-one main-wrapper">
                        <figure className="landing-text-image">
                            <span className="image" style={{backgroundImage: 'url("https://commoncdn.entrata.com/website_templates/esprit_2/images/slots/landing_text.jpg?ver=478781")'}} data-src="https://commoncdn.entrata.com/website_templates/esprit_2/images/slots/landing_text.jpg?ver=478781" />
                        </figure>
                        <div className="welcome-container">
                            <section className="welcome-text-container" role="main">
                                <h1 className="welcome-title">
                                    APARTMENTS NEAR CAMPUS MADE EASY
                                </h1>
                                <div className="welcome-text">Union on Plum offers modern 1 to 4 bedroom apartments near Colorado
                                    State campus and all the things that make the Fort Collins
                                    community unique and lovable. You’re never far away from fun
                                    or your classes- Union on Plum is at the center of it all! With
                                    tons of great amenities and several modern and spacious floor plans
                                    to choose from, you’ll love calling us home. We take care of
                                    everything - from apartment essentials to entertainment and
                                    recreation with cable, Internet and more included! Our inclusive
                                    package helps simplify living and maximize convenience to make your
                                    life easy.</div>
                            </section>
                        </div></div></section>
                <div>
                    <Footer className="footer"/>
                </div>
            </>
        );
    }
}


export default App;
